import React from 'react';
import { useHistory } from 'react-router-dom';

function Main() {
	const history = useHistory();
	function handleKeydown(e) {
		if (e.key === 'Enter') {
			history.push('/search');
		}
		// console.log('submit clicked');
	}
	return (
		<div>
			<h1>Movie</h1>
			<input onKeyDown={handleKeydown} />
		</div>
	);
}

export default Main;
